import './App.css';
import Header from './components/header/header';
import Image from './components/image/image';
import Summary from './components/summary/summary';
import Menu from './components/Menu/menu';

function App() {
  return (
    <div className="App">
      <MyContext.Provider>
        <Header/>
        <Image/>
        <Summary/>
        <Menu/>
      </MyContext.Provider>
    </div>
  );
}

export default App;
